import React from "react";

const ContactScreen = () => {
  return (
    <div className="contact-container">
      <form>
        <div className="form-group">
          <label htmlFor="name">Nombre</label>
          <input type="text" className="form_control" id="name" />
        </div>
      </form>
    </div>
  );
};

export default ContactScreen;
